Here is a simple example of how to create a Tooltip in NextJS using React Context.

```jsx
// TooltipContext.js
import { createContext, useState } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  const openTooltip = (text) => {
    setTooltip(text);
  };

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ tooltip, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export { TooltipProvider, TooltipContext };
```

