In C, static variables and register variables are two types of storage class specifiers that can be used to declare variables. Here's a brief overview of each:

**Static Variables**

A static variable is a variable that retains its value between function calls. When a function is called, the static variable is initialized only once, and its value is preserved across subsequent calls to the function.

Here's an example:
```c
#include <stdio.h>

void my_function() {
    static int count = 0;
    count++;
    printf("%d\n", count);
}

int main() {
    my_function(); // prints 1
    my_function(); // prints 2
    my_function(); // prints 3
    return 0;
}
```
In this example, the `count` variable is declared as `static`, which means it retains its value between function calls. Each time `my_function` is called, the value of `count` is incremented and printed.

**Register Variables**

A register variable is a variable that is stored in a CPU register, which is a small amount of on-chip memory that is faster to access than main memory. Register variables are typically used to improve performance by reducing the number of memory accesses.

Here's an example:
```c
#include <stdio.h>

void my_function() {
    register int x = 5;
    printf("%d\n", x);
}

int main() {
    my_function(); // prints 5
    return 0;
}
```
